script: |
  super -f text -I q10234.spq | sort > q10234.out

inputs:
  - name: q10234.spq
    data: |
      SELECT DISTINCT - col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE 14 BETWEEN NULL AND col1 + col2 + ( col0 ) * - col0 + + + col1;
  - name: tab0

outputs:
  - name: q10234.out
    data: |
